import React from 'react';
import './App.css';

const Header: React.FC = () => {
  return (
    <div className="Header">
      <h1>
        <a href="/">5sActivity</a>
      </h1>
      <ul>
        <li>
          <a href="/">GOAL</a>
        </li>
        <li>
          <a href="/">BASE</a>
        </li>
        <li>
          <a href="/">RECORD</a>
        </li>
        <li>
          <a href="/">EVENT</a>
        </li>
      </ul>
    </div>
  )
}
const Footer: React.FC = () => {
  return (
    <div className="Footer">© All rights reserved by T.H</div>
  )
}

const App: React.FC = () => {
  const message: string = "こんちは";
  return (
    <div className="App">
      <Header />
      <p>はろー</p>
      <p>{ message }</p>
      <Footer />
    </div>
  );
}

export default App;
